import { Header} from '../organisms'
import { useState } from 'react';

const withLayout = Page => {
  const [nav, setNav] = useState([
    {
        "title": "Issues",
        "url": "/issues"
    },
    {
        "title": "Stories",
        "url": "/stories"
    },
    {
        "title": "About us",
        "url": "about"
    }
])

  return () => (
    <>
      <Header items={nav}/>
      <Page />
    </>
  );
};

export default withLayout;
